import React from 'react';
import { Button } from '../Button/';

export interface MainProps {
  data: any;
}

const Main: React.SFC<MainProps> = ({ data }) => {
  return (
    <div className="col p-2">
      <h2>Dashboard - {data.getGlobalConfig.businessName}</h2>
      <p>Welcome back {data.getGlobalConfig.fullName}!</p>
      <Button
        submitPrice={() => alert('Add Product clicked!')}
        updatePrice={2}
        query=""
        price={2}
        mutateLoading={true}
      >
        Add Product
      </Button>
      <table className="table table-borderless">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Product</th>
            <th scope="col">Price</th>
            <th scope="col">Image</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Pokemon Shirt</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Lava Lamp</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Friends (BluRay)</td>
            <td>Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Main;
